import Head from "next/head";
import Layout from "../components/layout";
import fetch from "isomorphic-fetch";

const Index = () => {
  Index.getInitialProps = (ctx) => {};

  return (
    <Layout>
      <Head>
        <title>Index-page</title>
      </Head>
      <h1>Index page</h1>
    </Layout>
  );
};

export default Index;
